import React from 'react';
import styled from 'styled-components';

function Loading() {
	return (
		<LoadingWrapper>
			<div />
		</LoadingWrapper>
	);
}

const LoadingWrapper = styled.div`
	border: 1px solid black;
	width: 100%;
	height: 100%;
`;

export default Loading;
